INSERT INTO `forms` (`id`, `type`, `title`, `description`, `form`, `created_at`, `created_by`, `deleted_at`, `deleted_by`) VALUES
(2, 'master', '', '', '{\r\n        \"title\": \"Kuesioner Tracer Data Alumni Periode Januari-Juni 2020\",\r\n        \"description\": \"Data ini hanya bisa diisi oleh alumni yang terdaftar dalam database kami. Jika anda belum memiliki akun yang terdaftar dalam sistem kami, mohon hubungi admin Sistem Tracer Data Fakultas Farmasi di +62 823 1146 3010\",\r\n        \"tag\": \"Mohon diisi dengan data yang sebenar-benarnya, anda bertanggungjawab penuh terhadap informasi yang akan anda berikan pada kuesioner berikut.\",\r\n        \"form\": [\r\n            {\r\n                \"question\": \"Apa kegiatan anda saat ini?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"radio\",\r\n                \"id\": \"name-1\",\r\n                \"answers\": [\"Bekerja\", \"Membuka usaha\", \"Belum bekerja\"]\r\n            },\r\n            {\r\n                \"question\": \"Bagian untuk yang sudah bekerja\",\r\n                \"required\": \"true\",\r\n                \"type\": \"section\"\r\n            },\r\n            {\r\n                \"question\": \"Nama perusahaan tempat anda bekerja?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-2\"\r\n            },\r\n            {\r\n                \"question\": \"Alamat perusahaan tempat anda bekerja?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-3\"\r\n            },\r\n            {\r\n                \"question\": \"Alamat web perusahaan tempat anda bekerja?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-4\"\r\n            },\r\n            {\r\n                \"question\": \"Sektor perusahaan/industri tempat anda bekerja?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-5\"\r\n            },\r\n            {\r\n                \"question\": \"Tanggal mulai anda bekerja?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"date\",\r\n                \"id\": \"name-6\"\r\n            },\r\n            {\r\n                \"question\": \"Posisi anda saat pertama kali bekerja?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-7\"\r\n            },\r\n            {\r\n                \"question\": \"Berapa gaji pertama anda?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-8\"\r\n            },\r\n            {\r\n                \"question\": \"Darimana anda mendapatkan informasi lowongan pekerjaan?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"radio\",\r\n                \"id\": \"name-9\",\r\n                \"answers\": [\r\n                    \"Media massa (koran, televisi atau radio)\",\r\n                    \"Pengumuman di kampus\",\r\n                    \"Teman sesama alumni\",\r\n                    \"Kerabat/keluarga\",\r\n                    \"Lainnya\"\r\n                ]\r\n            },\r\n            {\r\n                \"question\": \"Menurut anda dalam skala 1-5 (1=sangat tidak relevan dan 5=sangat relevan), bagaimana relevansi pekerjaan anda dengan bidang ilmu yang anda tempuh saat kuliah?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"range\",\r\n                \"id\": \"name-10\",\r\n                \"length\": \"5\",\r\n                \"minimum\": \"Sangat tidak relevan\",\r\n                \"maximum\": \"Sangat relevan\"\r\n            },\r\n            {\r\n                \"question\": \"Menurut anda, mata kuliah apa yang anda dapatkan dari bangku kuliah yang paling relevan dengan pekerjaan anda saat ini?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-11\"\r\n            },\r\n            {\r\n                \"question\": \"Bagian untuk yang membuka usaha\",\r\n                \"required\": \"true\",\r\n                \"type\": \"section\"\r\n            },\r\n            {\r\n                \"question\": \"Nama perusahaan/usaha yang anda bangun?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-12\"\r\n            },\r\n            {\r\n                \"question\": \"Alamat perusahaan/usaha yang anda bangun?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-13\"\r\n            },\r\n            {\r\n                \"question\": \"Alamat web perusahaan/usaha yang anda bangun?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-14\"\r\n            },\r\n            {\r\n                \"question\": \"Bidang usaha yang anda bangun?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-15\"\r\n            },\r\n            {\r\n                \"question\": \"Jumlah karyawan perusahaan/usaha yang anda bangun, termasuk pemilik perusahaan/usaha?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-16\"\r\n            },\r\n            {\r\n                \"question\": \"Berapa omzet anda per bulan dari usaha yang anda bangun?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-17\"\r\n            },\r\n            {\r\n                \"question\": \"Berapa besar rata-rata pengeluaran anda per bulan?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-18\"\r\n            },\r\n            {\r\n                \"question\": \"Menurut anda dalam skala 1-5 (1=sangat tidak relevan dan 5=sangat relevan), bagaimana relevansi pekerjaan anda dengan bidang ilmu yang anda tempuh saat kuliah?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"range\",\r\n                \"id\": \"name-19\",\r\n                \"length\": \"5\",\r\n                \"minimum\": \"Sangat tidak relevan\",\r\n                \"maximum\": \"Sangat relevan\"\r\n            },\r\n            {\r\n                \"question\": \"Bagian untuk yang belum bekerja\",\r\n                \"required\": \"true\",\r\n                \"type\": \"section\"\r\n            },\r\n            {\r\n                \"question\": \"Kegiatan apa yang sedang anda lakukan saat ini?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"radio\",\r\n                \"id\": \"name-20\",\r\n                \"answers\": [\r\n                    \"Mencari pekerjaan yang sesuai\",\r\n                    \"Melanjutkan/sedang mempersiapkan pendidikan tingkat lanjut\",\r\n                    \"Mengikuti suami (menjadi Ibu rumah tangga)\",\r\n                    \"Membantu orang tua\",\r\n                    \"Lainnya\"\r\n                ]\r\n            },\r\n            {\r\n                \"question\": \"Akhir bagian\",\r\n                \"required\": \"true\",\r\n                \"type\": \"section\"\r\n            },\r\n            {\r\n                \"question\": \"Menurut anda, apa yang harus dilakukan pihak fakultas agar anda bisa cepat mendapatkan pekerjaan yang sesuai?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-21\"\r\n            },\r\n            {\r\n                \"question\": \"Adakah saran anda yang lain untuk perbaikan fakultas?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-22\"\r\n            }\r\n        ]    \r\n    }', '2021-01-11 08:28:01', 1, NULL, NULL),
