               \"id\": \"name-11\"\r\n            },\r\n            {\r\n                \"question\": \"Bagian untuk yang membuka usaha\",\r\n                \"required\": \"true\",\r\n                \"type\": \"section\"\r\n            },\r\n            {\r\n                \"question\": \"Nama perusahaan/usaha yang anda bangun?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-12\"\r\n            },\r\n            {\r\n                \"question\": \"Alamat perusahaan/usaha yang anda bangun?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-13\"\r\n            },\r\n            {\r\n                \"question\": \"Alamat web perusahaan/usaha yang anda bangun?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-14\"\r\n            },\r\n            {\r\n                \"question\": \"Bidang usaha yang anda bangun?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-15\"\r\n            },\r\n            {\r\n                \"question\": \"Jumlah karyawan perusahaan/usaha yang anda bangun, termasuk pemilik perusahaan/usaha?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-16\"\r\n            },\r\n            {\r\n                \"question\": \"Berapa omzet anda per bulan dari usaha yang anda bangun?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-17\"\r\n            },\r\n            {\r\n                \"question\": \"Berapa besar rata-rata pengeluaran anda per bulan?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-18\"\r\n            },\r\n            {\r\n                \"question\": \"Menurut anda dalam skala 1-5 (1=sangat tidak relevan dan 5=sangat relevan), bagaimana relevansi pekerjaan anda dengan bidang ilmu yang anda tempuh saat kuliah?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"range\",\r\n                \"id\": \"name-19\",\r\n                \"length\": \"5\",\r\n                \"minimum\": \"Sangat tidak relevan\",\r\n                \"maximum\": \"Sangat relevan\"\r\n            },\r\n            {\r\n                \"question\": \"Bagian untuk yang belum bekerja\",\r\n                \"required\": \"true\",\r\n                \"type\": \"section\"\r\n            },\r\n            {\r\n                \"question\": \"Kegiatan apa yang sedang anda lakukan saat ini?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"radio\",\r\n                \"id\": \"name-20\",\r\n                \"answers\": [\r\n                    \"Mencari pekerjaan yang sesuai\",\r\n                    \"Melanjutkan/sedang mempersiapkan pendidikan tingkat lanjut\",\r\n                    \"Mengikuti suami (menjadi Ibu rumah tangga)\",\r\n                    \"Membantu orang tua\",\r\n                    \"Lainnya\"\r\n                ]\r\n            },\r\n            {\r\n                \"question\": \"Akhir bagian\",\r\n                \"required\": \"true\",\r\n                \"type\": \"section\"\r\n            },\r\n            {\r\n                \"question\": \"Menurut anda, apa yang harus dilakukan pihak fakultas agar anda bisa cepat mendapatkan pekerjaan yang sesuai?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-21\"\r\n            },\r\n            {\r\n                \"question\": \"Adakah saran anda yang lain untuk perbaikan fakultas?\",\r\n                \"required\": \"true\",\r\n                \"type\": \"input\",\r\n                \"id\": \"name-22\"\r\n            }\r\n        ]    \r\n    }', 